function getScript(url, success) {
    var script = document.createElement('script');
    script.src = url;
    var head = document.getElementsByTagName('head')[0],
        done = false;
    
    // Attach handlers for all browsers
    script.onload = script.onreadystatechange = function() {
        if (!done && (!this.readyState || this.readyState == 'loaded' || this.readyState == 'complete')) {
            done = true;
            //$.noConflict();
            window._$ = jQuery;
            success();
            script.onload = script.onreadystatechange = null;
            head.removeChild(script);
        };
    };
    head.appendChild(script);
};

getScript('https://code.jquery.com/jquery-2.1.0.min.js', function(){
    var layer;
    var box = $("<div>").css({
            width: 16, height: 16,
            border: "1px solid #d3d6db",
            position: "absolute",
            zIndex: 401,
            padding: 2,
            backgroundColor: "#edeff4",
            /*backgroundImage: "url(https://fbstatic-a.akamaihd.net/rsrc.php/v2/yl/r/djWWR4XJTnA.png)",
            backgroundPosition: "-168px -144px",
            backgroundClip: "content-box",
            backgroundRepeat: "no-repeat",*/
            cursor: "pointer",
        	webkitUserSelect: "none"
        }).attr({
        	title: "Emoji"
        }).addClass("uiContextualLayer").append($("<div>").css({
        	width: 16, height: 16,
        	backgroundImage: "url(https://fbstatic-a.akamaihd.net/rsrc.php/v2/yl/r/djWWR4XJTnA.png)",
            backgroundPosition: "-170px -146px",
            padding: 0,
        	pointerEvents: "none"
        })),
        selector = $("<div>").css({
            width: 305, height: 221,
            border: "1px solid #d3d6db",
            backgroundColor: "#f6f7f8",
            backgroundImage: "url("+sprite+")",
            backgroundPosition: "2px 2px",
            backgroundRepeat: "no-repeat",
            padding: 2,
            position: "absolute",
            zIndex: 402,
            boxShadow: "0px 5px 7px rgba(153, 153, 153, 0.8)"
        }),
        mousedownele = null, currentTextarea = null, focusing = false;
    $(document).on("focus", "textarea[name=add_comment_text_text]", function(){
        if(!focusing){
            focusing = true;
        currentTextarea = this;
        var container = $(this).parents(".textBoxContainer");
		layer = $(this).parents(".uiContextualLayerParent");
        selector.removeClass("displaying");
        box.css({
            top: container.offset().top + container.height() - 1 - layer.offset().top,
            left: container.offset().left + container.width() - 20 - 2 - layer.offset().left
        }).appendTo(layer).slideUp(0).slideDown(150).unbind("click contextmenu").on("click contextmenu", function(e){
            if(selector.hasClass("displaying")){
                selector.remove();
            }else{
                selector.css({
                    top: container.offset().top + container.height() - 1 - layer.offset().top,
                    left: container.offset().left - layer.offset().left
                }).appendTo(layer).fadeOut(0).fadeIn(100).unbind("mousemove").mousemove(function(e){
                    var x = e.offsetX, y = e.offsetY,
                        isGapX = x < 2 ? true : (x-2)%17 == 0,
                        isGapY = y < 2 ? true : (y-2)%17 == 0;
                    $(this).css({cursor: isGapX || isGapY ? "default" : "pointer"});
                }).unbind("click contextmenu").on("click contextmenu", function(e){
                    if (currentTextarea.classList.contains('DOMControl_placeholder')) {
                        currentTextarea.classList.remove('DOMControl_placeholder');
                        currentTextarea.value = '';
                    }
                    currentTextarea.focus();
                    var val = $(currentTextarea).val();
                    $(currentTextarea).val(val + (mapSymbols(e.offsetX, e.offsetY)));
                    e.preventDefault();
                });
            }
            selector.toggleClass("displaying");
            e.preventDefault();
        });
        }
    }).on("blur", "textarea[name=add_comment_text_text]", function(){
        if(mousedownele !== box[0] && mousedownele !== selector[0]){
            box.remove();
            selector.remove();
            currentTextarea = null;
            focusing = false;
        }
    }).on("mousedown", box, function(e){
        mousedownele = e.target;
    }).on("mousedown", function(e){
        if(e.toElement !== box[0] && e.toElement !== currentTextarea && e.toElement !== selector[0]){
            box.remove();
            selector.remove();
            currentTextarea = null;
            focusing = false;
        }
    }).on("keyup", "textarea[name=add_comment_text_text]", function(e){
        if(e.keyCode == 13){
            if(!e.ctrlKey && !e.shiftKey && !e.altKey){
                //box.remove();
                selector.remove();
                //currentTextarea = null;
            	//focusing = false;
            }
        }
        var container = $(this).parents(".textBoxContainer");
        box.css({
            top: container.offset().top + container.height() - 1 - layer.offset().top,
            left: container.offset().left + container.width() - 20 - 2 - layer.offset().left
        });
        selector.css({
            top: container.offset().top + container.height() - 1 - layer.offset().top,
            left: container.offset().left - layer.offset().left
        })
    }).on("mousewheel touchmove", ".uiScrollableArea", function(e){
        if(e.type == "touchmove") setTimeout(function(){ e.preventDefault(); });
        //Facebook scroll area delay
        var _this = this;
        setTimeout(function(){
            var container = $(currentTextarea).parents(".textBoxContainer");
            box.css({
                top: container.offset().top + container.height() - 1 - layer.offset().top,
                left: container.offset().left + container.width() - 20 - 2 - layer.offset().left
            });
            selector.css({
                top: container.offset().top + container.height() - 1 - layer.offset().top,
                left: container.offset().left - layer.offset().left
            })
        }, 1);
    })
});

