function createMap(txt){
    //txt = txt.match(/.{1,18}/g);
    for(var i = 0; i < txt.length; i++){
        for(var j = 0, s = 0; j < txt[i].length; j+=2, s++){
            map[""+(2+s*17)+","+(2+i*17)] = txt[i].substring(j, j+2);
        }
    }
}

function mapSymbols(x, y){
    var selX = x - (x - 2)%17, selY = y - (y - 2)%17;
    return map[selX+","+selY].replace(/\s/g, "").replace(/[0-9A-F]{2}/, function(c){
        return special[c];
    });
}


